// UncontrolledLottie.jsx
import React, { Component } from 'react'
import Lottie from 'react-lottie'
import animationData from './cursor.json'

class Click extends Component {

  render(){

    const buttonStyle = {
      display: 'inline-block',
      margin: '10px auto',
      marginRight: '10px',
      border: 'none',
      color: 'white',
      borderRadius: '2px',
      fontSize: '15px'
    };

    const defaultOptions = {
      loop: true,
      autoplay: true,
      animationData: animationData,
      rendererSettings: {
        preserveAspectRatio: 'xMidYMid slice'
      }
    };

    return(
      <div className='click'>
        <Lottie options={defaultOptions} style={clickStyle}
              height={200}
              width={200}
        />
      </div>
    )
  }
}

export default Click
